package org.kuali.common.devops.aws;

import org.kuali.common.aws.model.AwsKey;
import org.kuali.common.util.Assert;

public enum Keys {

	FOUNDATION("kuali-key", "", ""), //
	RICE(
			"kr-key",
			"ssh-rsa  kr-key",
			"ENC()"), //

	KS(
			"ks-key",
			"ssh-rsa  ks-key",
			"ENC()"), //
	OLE("ole", "", "");

	private final AwsKey key;

	private Keys(String name, String publicKey, String privateKey) {
		Assert.noBlanks(name, publicKey, privateKey);
		this.key = new AwsKey(name, publicKey, privateKey);
	}

	public AwsKey getKey() {
		return key;
	}

}
